import React from "react";
import { BrowserRouter, Routes, Route, Navigate, Link } from "react-router-dom";

import "./styles.css";

function HomePage() {
  return <div className="page">üè† Page</div>;
}

function NotFoundPage() {
  return <div className="page">üßê Page</div>;
}

function ApplePage() {
  return <div className="page">üçé Page</div>;
}

export default function App() {
  return (
    <BrowserRouter>
      <div>
        <Link to="/" className="link">
          Home
        </Link>
        <Link to="/apple" className="link">
          Apple
        </Link>
        <Link to="/applet" className="link">
          Applet
        </Link>
        <Link to="/test" className="link">
          Test
        </Link>
      </div>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/404" element={<NotFoundPage />} />
        <Route path="/apple">
          <Route path="/" element={<ApplePage />} />
          <Route path="*" element={<Navigate replace to="/apple" />} />
        </Route>
        <Route path="*" element={<Navigate replace to="/404" />} />
      </Routes>
    </BrowserRouter>
  );
}
